import React from "react";
import "../App.css";
import Banner from "../components/Banner";
import NewItems from "../components/NewItems";
import Footer from "../components/Footer";
import CloudEdge from "../components/CloudEdge";
import Testimonial from "../components/Testimonial";
import data from "../data.json";
import "./Home.css";

function Home() {
  return (
    <>
      <Banner />
      <CloudEdge />
      <div className="container">
        <div className="testimonial-container">
          <div className="sales-container">
            {/* <div className="data-heading">
              Get answers to your burning questions from an experienced tarot
              reader
            </div> */}
            <h1 className="data-heading">Join hundreds of others who've u</h1>
            <h1 className="page-title-2">My Experience</h1>
            <ul className="data">
              <li className="data-li">
                Over
                <strong> 1,300</strong> readings given
              </li>
              <li className="data">
                <strong>4.9</strong> star average rating
              </li>
              <li className="data">
                <strong>300+</strong> testimonials
              </li>
            </ul>
          </div>
          <Testimonial testimonialData={data} />
        </div>
        <div className="thumbnail-container-container">
          <NewItems />
        </div>
      </div>
      <Footer />
    </>
  );
}

export default Home;
